}

.header:hover .navbar-foot:after,
.mobile-on .navbar-foot:after {
    background: black !important;
}

@media (max-width: 650px) {
    .not-mobile {
        display: none;
    }
}

.mobile-on ul.navbar-list {
    flex-direction: column; /* NEW - Safari 6.1+. iOS 7.1+, BB10 */ /* OLD - iOS 6-, Safari 3.1-6, BB7 */ /* TWEENER - IE 10 */
