.mobile-on li.navbar-link {
    -webkit-animation: fadeIn 1s ease forwards;
            animation: fadeIn 1s ease forwards;
    -webkit-animation-delay: 0.35s;
            animation-delay: 0.35s;
    opacity: 0;
}

.mobile-on li.navbar-link:nth-of-type(2) {
